import './App.css';
import Overview from './pages/overview';

function App() {
  return (
    <BrowserRouter className="App">
      <Routes>
        <Route index element={<Overview />} />
        <Route path="user" element={<Product />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
